import ExpenseItem from './ExpenseItem';
import './Expenses.css'

function Expenses(props){
    return(
        <div className='expenses'>
            <ExpenseItem title={props.expenseItems[0].tile} amount={props.expenseItems[0].amount} date={props.expenseItems[0].date}/>
            <ExpenseItem title={props.expenseItems[1].tile} amount={props.expenseItems[1].amount} date={props.expenseItems[1].date}/>
            <ExpenseItem title={props.expenseItems[2].tile} amount={props.expenseItems[2].amount} date={props.expenseItems[2].date}/>
            <ExpenseItem title={props.expenseItems[3].tile} amount={props.expenseItems[3].amount} date={props.expenseItems[3].date}/>
        </div>
    );
}
export default Expenses;
